import{o as n,c as s,a,b as e,t as l,d as t}from"./app.52b163c2.js";const p='{"title":"git 使用说明","description":"","frontmatter":{"title":"git 使用说明"},"headers":[{"level":2,"title":"基本命令","slug":"基本命令"},{"level":2,"title":"命令","slug":"命令"},{"level":3,"title":"常用命令","slug":"常用命令"},{"level":3,"title":"分支","slug":"分支"},{"level":2,"title":"使用流程","slug":"使用流程"},{"level":3,"title":"注册","slug":"注册"},{"level":3,"title":"绑定","slug":"绑定"},{"level":3,"title":"配置","slug":"配置"},{"level":3,"title":"使用","slug":"使用"}],"relativePath":"TechnologyStack/Other/git.md","lastUpdated":1623341278371}',c={},r={id:"frontmatter-title"},i=a("a",{class:"header-anchor",href:"#frontmatter-title","aria-hidden":"true"},"#",-1),o=t('<blockquote><p>代码管理 &amp; 迭代 的工具 <a href="https://blog.csdn.net/weixin_44950987/article/details/102619708?depth_1-utm_source=distribute.pc_relevant.none-task-blog-BlogCommendFromBaidu-1&amp;utm_source=distribute.pc_relevant.none-task-blog-BlogCommendFromBaidu-1" target="_blank" rel="noopener noreferrer">参考文档</a> || <a href="https://blog.csdn.net/halaoda/article/details/78661334?utm_medium=distribute.pc_relevant.none-task-blog-2%7Edefault%7EBlogCommendFromMachineLearnPai2%7Edefault-1.control&amp;depth_1-utm_source=distribute.pc_relevant.none-task-blog-2%7Edefault%7EBlogCommendFromMachineLearnPai2%7Edefault-1.control" target="_blank" rel="noopener noreferrer">命令大全</a></p></blockquote><h2 id="基本命令"><a class="header-anchor" href="#基本命令" aria-hidden="true">#</a> 基本命令</h2><div class="language-shell line-numbers-mode"><pre><code><span class="token comment"># 提交</span>\n<span class="token function">git</span> <span class="token function">add</span> <span class="token builtin class-name">.</span> <span class="token comment"># . 全部 也可以单个文件提交</span>\n<span class="token comment"># 给提交的内容 输入备注</span>\n<span class="token function">git</span> commit -m <span class="token string">&#39;&#39;</span> <span class="token comment"># 引号里面是 备注的内容</span>\n<span class="token comment"># 获取</span>\n<span class="token function">git</span> pull <span class="token comment"># 拉取最新的代码 防止冲突</span>\n<span class="token comment"># 推送</span>\n<span class="token function">git</span> push <span class="token comment"># 推送前 需要解决现有的冲突</span>\n</code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br></div></div><hr><h2 id="命令"><a class="header-anchor" href="#命令" aria-hidden="true">#</a> 命令</h2><h3 id="常用命令"><a class="header-anchor" href="#常用命令" aria-hidden="true">#</a> 常用命令</h3><div class="language-shell line-numbers-mode"><pre><code><span class="token comment"># 查看状态</span>\n<span class="token function">git</span> status\n<span class="token comment"># 查看文件都修改了什么</span>\n<span class="token function">git</span> <span class="token function">diff</span> 文件名\n<span class="token comment"># 查看日志</span>\n<span class="token function">git</span> log\n\n<span class="token comment"># 历史版本管理</span>\n<span class="token function">git</span> reflog <span class="token comment"># 查看历史版本 =&gt; 附带版本号</span>\n<span class="token function">git</span> reset --hard 版本号 <span class="token comment"># 回退到指定版本</span>\n<span class="token comment"># 回退到历史版本</span>\n<span class="token function">git</span> reset --hard HEAD^ <span class="token comment"># 代表上一个版本</span>\n<span class="token function">git</span> reset --hard HEAD^^ <span class="token comment"># 代表上上版 </span>\n<span class="token function">git</span> reset --hard HEAD~数字 <span class="token comment"># 同上</span>\n\n<span class="token comment"># 撤销修改</span>\n<span class="token function">git</span> checkout --文件名 <span class="token comment"># 将上一次提交的文件 拉回工作区 =&gt; 已add 但未commit</span>\n<span class="token comment"># 方法一: 回退到上一版本</span>\n<span class="token comment"># 方法二: 手动更改文件 再 add =&gt; commit</span>\n<span class="token comment"># 方法三: </span>\n<span class="token function">git</span> restore --文件名 <span class="token comment"># 丢弃工作区的修改</span>\n\n<span class="token comment"># 本地文件远程关联github仓库</span>\n<span class="token function">git</span> remote <span class="token function">add</span> origin git@github.com:wangxin98521/ceshi.git\n\n<span class="token comment"># 上传本地代码</span>\n<span class="token function">git</span> push -u origin master <span class="token comment"># 简写: git push</span>\n</code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br><span class="line-number">14</span><br><span class="line-number">15</span><br><span class="line-number">16</span><br><span class="line-number">17</span><br><span class="line-number">18</span><br><span class="line-number">19</span><br><span class="line-number">20</span><br><span class="line-number">21</span><br><span class="line-number">22</span><br><span class="line-number">23</span><br><span class="line-number">24</span><br><span class="line-number">25</span><br><span class="line-number">26</span><br><span class="line-number">27</span><br></div></div><h3 id="分支"><a class="header-anchor" href="#分支" aria-hidden="true">#</a> 分支</h3><div class="language-shell line-numbers-mode"><pre><code><span class="token comment"># 查看分支</span>\n<span class="token function">git</span> branch\n<span class="token comment"># 创建分支</span>\n<span class="token function">git</span> branch 分支名称 <span class="token comment"># 创建并切换 =&gt; git checkout -b 分支名</span>\n<span class="token comment"># 切换分支:</span>\n<span class="token function">git</span> checkout 分支名称 \n<span class="token comment"># 删除分支:</span>\n<span class="token function">git</span> branch -d 分支名称\n<span class="token comment"># 更改分支名称:</span>\n<span class="token function">git</span> reset –hard 分支重命名\n<span class="token comment"># 合并某分支到当前分支</span>\n<span class="token function">git</span> merge 被合并的分支名\n\n<span class="token comment"># 更新云端分支代码到本地:</span>\n<span class="token function">git</span> pull origin 云端分支名称\n<span class="token comment"># 将本地代码上传到云端</span>\n<span class="token function">git</span> push origin 本地分支:云端分支\n<span class="token comment"># 删除远程分支</span>\n<span class="token function">git</span> push origin --delete 分支名称\n<span class="token comment"># 将远程git仓库里的指定分支拉取到本地（本地不存在的分支）</span>\n<span class="token function">git</span> checkout -b 本地分支名 origin/远程分支名\n</code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br><span class="line-number">14</span><br><span class="line-number">15</span><br><span class="line-number">16</span><br><span class="line-number">17</span><br><span class="line-number">18</span><br><span class="line-number">19</span><br><span class="line-number">20</span><br><span class="line-number">21</span><br></div></div><h2 id="使用流程"><a class="header-anchor" href="#使用流程" aria-hidden="true">#</a> 使用流程</h2><h3 id="注册"><a class="header-anchor" href="#注册" aria-hidden="true">#</a> 注册</h3><blockquote><p>程序员怎么可以没有自己的GitHub账号呢???<br> 有条件上<a href="https://github.com/" target="_blank" rel="noopener noreferrer">github</a> 没条件上<a href="https://gitee.com/" target="_blank" rel="noopener noreferrer">gitee</a></p></blockquote><ul><li>gitee 属于国内,商业气息较重;中文 适合国内开发者</li><li>github 属于国外,有墙;优秀项目较多 开源</li><li>只要代码写得好,上哪个都一样</li></ul><h3 id="绑定"><a class="header-anchor" href="#绑定" aria-hidden="true">#</a> 绑定</h3><ul><li>电脑需要生成key 存于 账号中</li></ul><div class="language-shell line-numbers-mode"><pre><code><span class="token comment"># -C来指定所指定的注释，可以方便用户标识这个密钥</span>\nssh-keygen -t rsa -C <span class="token string">&quot;youremail@example.com&quot;</span>\n</code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><ul><li>绑定到账号<br><ul><li>生成的ssh公钥存放路径在 <code>[c盘-&gt;用户-&gt;自己的用户名-&gt;.ssh]</code> 目录下<br></li><li>将<code>id_rsa.pub</code> 文件内容(以文本打开) 复制<br></li><li>添加到 git中: <code>[账号头像-&gt;设置-&gt;SSH and GPG keys-&gt;new ssh key]</code></li></ul></li></ul><h3 id="配置"><a class="header-anchor" href="#配置" aria-hidden="true">#</a> 配置</h3><blockquote><p>电脑需要配置身份信息 -&gt; 这样就知道代码是谁提交的</p></blockquote><div class="language-shell line-numbers-mode"><pre><code><span class="token function">git</span> config --global user.name <span class="token string">&quot;用户名&quot;</span>\n<span class="token function">git</span> config --global user.email <span class="token string">&quot;邮箱&quot;</span>\n</code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><h3 id="使用"><a class="header-anchor" href="#使用" aria-hidden="true">#</a> 使用</h3><div class="language-shell line-numbers-mode"><pre><code><span class="token comment"># 初始化 在代码根目录执行</span>\n<span class="token function">git</span> init\n<span class="token comment"># 提交代码</span>\n<span class="token function">git</span> <span class="token function">add</span> <span class="token builtin class-name">.</span> <span class="token comment"># 提交所有文件</span>\n<span class="token function">git</span> <span class="token function">add</span> views <span class="token comment"># 提交该views 目录下所有文件</span>\n<span class="token function">git</span> <span class="token function">add</span> app.js <span class="token comment"># 提交app.js 单个文件</span>\n<span class="token comment"># 当前提交注释</span>\n<span class="token function">git</span> commit -m <span class="token string">&quot;初始化&quot;</span> <span class="token comment"># 提交时 说明当前提交了什么</span>\n<span class="token comment"># 绑定仓库</span>\n<span class="token function">git</span> remote <span class="token function">add</span> origin 仓库地址 <span class="token comment"># 提前在账号中注册一个仓库</span>\n<span class="token comment"># 推送到仓库去</span>\n<span class="token function">git</span> push -u origin master\n</code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br></div></div>',22);c.render=function(t,p,c,m,u,b){return n(),s("div",null,[a("h1",r,[i,e(" "+l(t.$frontmatter.title),1)]),o])};export default c;export{p as __pageData};
